import React, { useEffect, useState } from 'react'
import { getLineData } from '../api'
import { LineChart } from '@mui/x-charts/LineChart';

function Line() {
    const [lineData, setLineData] = useState([])

    useEffect(() => {
        getLineData()
            .then(res => {
                setLineData(res)
            })
        return () => { }
    }, [])
    useEffect(() => {
        console.log("Graph data")
        console.log(lineData)
    }, [lineData])
    return (
        // <div>GraphChart</div>
        <LineChart
            // width={500}
            // height={300}
            series={[{ data: lineData.map((elem) => elem.y) }]}
            xAxis={[{ scaleType: 'point', data: lineData.map((elem) => elem.x) }]}
        />
    )
}

export default Line
